import {IUser} from "./interfaces/app.interfaces";

export class UserService {

  public users: IUser[] = [
    {id: 1, name: 'neda', email: 'n@n.gmail.com'},
    {id: 2, name: 'ali', email: 'a@a.gmail.com'},
    {id: 3, name: 'eli', email: 'e@e.gmail.com'}
  ]
}
